import{_ as e,o as a,c as r,e as t}from"./app.b215b85c.js";const h={},n=t('<h1 id="charts" tabindex="-1"><a class="header-anchor" href="#charts" aria-hidden="true">#</a> Charts</h1><p>Misskey can generate and display charts for an instance&#39;s various federated data sources. Charts allow you to get a visual depiction of the usage, federation status, and activity of each user.</p><p>Instance charts can be viewed from the <em>instance information</em> page (accessible by clicking the instance logo in the navigation menu).</p><p>Below is a description of each chart and its contents.</p><h2 id="federation-chart" tabindex="-1"><a class="header-anchor" href="#federation-chart" aria-hidden="true">#</a> Federation Chart</h2><p>This chart shows information about federated instances.</p><h3 id="pub" tabindex="-1"><a class="header-anchor" href="#pub" aria-hidden="true">#</a> Pub</h3><p>The number of instances that this instance is publishing activities to.</p><h3 id="sub" tabindex="-1"><a class="header-anchor" href="#sub" aria-hidden="true">#</a> Sub</h3><p>The number of instances that this instance is receiving activities from.</p><h3 id="received" tabindex="-1"><a class="header-anchor" href="#received" aria-hidden="true">#</a> Received</h3><p>The number of instances that have sent an activity to this instance.</p><h3 id="delivered" tabindex="-1"><a class="header-anchor" href="#delivered" aria-hidden="true">#</a> Delivered</h3><p>The number of instances that this instance has delivered an activity to.</p><h3 id="stalled" tabindex="-1"><a class="header-anchor" href="#stalled" aria-hidden="true">#</a> Stalled</h3><p>The number of instances where an error was encountered when delivering an activity.</p><h2 id="active-users-chart" tabindex="-1"><a class="header-anchor" href="#active-users-chart" aria-hidden="true">#</a> Active Users Chart</h2><p>Chart of user activity on this instance.</p><h3 id="read-write" tabindex="-1"><a class="header-anchor" href="#read-write" aria-hidden="true">#</a> Read &amp; Write</h3><p>The number of users that have read and written.</p><h3 id="read" tabindex="-1"><a class="header-anchor" href="#read" aria-hidden="true">#</a> Read</h3><p>The number of users that have read.</p><h3 id="write" tabindex="-1"><a class="header-anchor" href="#write" aria-hidden="true">#</a> Write</h3><p>The number of users that have written.</p><h3 id="week" tabindex="-1"><a class="header-anchor" href="#week" aria-hidden="true">#</a> &lt; Week</h3><p>The number of users with an account less than one week old.</p><h3 id="month" tabindex="-1"><a class="header-anchor" href="#month" aria-hidden="true">#</a> &lt; Month</h3><p>The number of users with an account less than one month old.</p><h3 id="year" tabindex="-1"><a class="header-anchor" href="#year" aria-hidden="true">#</a> &lt; Year</h3><p>The number of users with an account less than one year old.</p><h3 id="week-1" tabindex="-1"><a class="header-anchor" href="#week-1" aria-hidden="true">#</a> &gt; Week</h3><p>The number of users with an account older than one week.</p><h3 id="month-1" tabindex="-1"><a class="header-anchor" href="#month-1" aria-hidden="true">#</a> &gt; Month</h3><p>The number of users with an account older than one month.</p><h3 id="year-1" tabindex="-1"><a class="header-anchor" href="#year-1" aria-hidden="true">#</a> &gt; Year</h3><p>The number of users with an account older than one year.</p>',36),i=[n];function s(d,c){return a(),r("div",null,i)}var u=e(h,[["render",s],["__file","charts.html.vue"]]);export{u as default};
